import React from "react";
import styled from "styled-components";

const SidebarContainer = styled.div`
  background-color: #212121;
  color: white;
  width: 250px;
  padding: 20px;
`;

const CalendarTitle = styled.h2`
  margin-bottom: 20px;
  font-size: 18px;
`;

const CalendarItem = styled.div`
  margin-bottom: 10px;
  font-size: 14px;
`;

const CalendarSubItem = styled.div`
  margin-left: 10px;
  font-size: 12px;
  color: #bbbbbb;
`;

function Sidebar() {
  return (
    <SidebarContainer>
      <CalendarTitle>이슈 캘린더</CalendarTitle>
      <CalendarItem>
        06월 11일 화요일
        <CalendarSubItem>- 일본은행(BOJ) 금융정책회의 1일차</CalendarSubItem>
      </CalendarItem>
      <CalendarItem>
        06월 12일 수요일
        <CalendarSubItem>- 일본은행(BOJ) 금융정책회의 2일차</CalendarSubItem>
      </CalendarItem>
      <CalendarItem>
        06월 15일 토요일
        <CalendarSubItem>- 리노스 추가상장(유상증자)</CalendarSubItem>
      </CalendarItem>
      {/* Add more calendar items as needed */}
    </SidebarContainer>
  );
}

export default Sidebar;
